CREATE PROCEDURE [dbo].[SP_TbProductorSelectName]
	@NOMBRE AS VARCHAR(20),
	@APELLIDO1 AS VARCHAR(50),
	@APELLIDO2 AS VARCHAR(50)
AS 
	SET NOCOUNT ON;
	SELECT PK_IdProductor, Nombre, Apellido1, Apellido2, Nombre + ' ' + Apellido1 + ' ' + Apellido2 as 'Nombre completo'
	FROM   [dbo].[TbProductor] 
	WHERE  Nombre like @NOMBRE and Apellido1 like @APELLIDO1 and Apellido2 like @APELLIDO2
	ORDER BY Nombre
GO
