    @Apellido2 varchar(50),
    @Direccion varchar(100),
    @NumeroTelefono varchar(15),
    @FechaNacimiento datetime,
    @EstadoCivil int,
    @Foto Image
AS 
	SET NOCOUNT ON 
	SET XACT_ABORT ON  
	
	BEGIN TRAN

	UPDATE [dbo].[TbActor]
	SET    [Nombre] = @Nombre, [Apellido1] = @Apellido1, [Apellido2] = @Apellido2, [Direccion] = @Direccion, [NumeroTelefono] = @NumeroTelefono, [FechaNacimiento] = @FechaNacimiento, [EstadoCivil] = @EstadoCivil, [Foto] = @Foto
