GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[SP_Reporting_CountPremiosXPelicula]
AS 
	SET NOCOUNT ON; 
	SELECT COUNT(pre.PK_IdPremio) AS 'Cantidad de Premios por película', peli.Titulo AS 'Título película'
	FROM TbPelicula AS peli
	INNER JOIN TbPremio AS pre
	ON peli.PK_IdPelicula= pre.FK_IdPelicula
	GROUP BY peli.Titulo
GO
/****** Object:  StoredProcedure [dbo].[SP_Reporting_CountCriticasXActor]    Script Date: 12/15/2013 14:32:16 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[SP_Reporting_CountCriticasXActor]
AS 
	SET NOCOUNT ON; 
	SELECT COUNT(c.PK_IdCritica) AS 'Cantidad de Criticas por actor', a.nombre + ' ' + a.Apellido1  + ' ' + a.Apellido2 AS 'Nombre actor'
	FROM TbPelicula AS p
	INNER JOIN TbCriticas AS c
	ON p.PK_IdPelicula = c.PK_IdCritica
	INNER JOIN TbActorXPelicula AS ap
	ON p.PK_IdPelicula = ap.FK_PK_IdPelicula
	INNER JOIN TbActor a
	ON a.PK_IdActor = ap.FK_PK_IdActor
	GROUP BY a.nombre, a.Apellido1, a.Apellido2
GO
