CREATE PROCEDURE [dbo].[SP_Reporting_CountActoresXPelicula]
AS 
	SET NOCOUNT ON; 
	SELECT COUNT(ap.FK_PK_IdActor) AS 'Cantidad de Actores por película', p.Titulo AS 'Título película'
	FROM TbPelicula AS p
	INNER JOIN TbActorXPelicula AS ap
	ON p.PK_IdPelicula= ap.FK_PK_IdPelicula
	GROUP BY p.Titulo
GO
